import React, { Component } from "react";
import HeaderNav from "../components/HeaderNav";
class FutureProjects extends Component {
    state={
        profileDisplay: false
        }
  render() {
    return (
      <div>
        <HeaderNav selected ={"Future Projects"}/>

      </div>
    );
  }
}
export default FutureProjects;
